import React from 'react';


export default function Hero() {
  return (
    <section className="hero services-section">
      <div className="container text-center position-relative">
        <h1 className="banner-font">
Nowhere Else but <span style="color: ##57b6b2">Success</span>        </h1>
        <p className="home-banner-subtext">
Start today and let our <span style="color: ##57b6b2">team</span>  handle the rest.        </p>
        <a href="/contact-us" className="contact-btn">
          احجز استشارتك المجانية
        </a>
      </div>
      {/* semi-transparent overlay */}
      <div
        className="position-absolute top-0 start-0 w-100 h-100"
        style={{ backgroundColor: 'rgba(0,0,0,0.5)' }}
      />
    </section>
  );
}
